window.bookSummaryJSON = "<p><b>Just as a threat is dealt with, an opportunity presents itself.</b></p> <p>After searching for months, Zac's forces have finally discovered the elusive Underworld that's both teeming with riches and dangers. Meanwhile, the armies of the Undead Empire advances on all fronts while the Dominators scheme in the dark.</p> <p>Having endured the Integration in the punishing environment of the subterranean cave system, the trapped warriors of the Underworld could become the key in surviving the incursions aboveground.</p> <p>But first, Zac has to deal with the golems intent on digging to the center of the planet.</p> <p><b>Book 4 of the hit Defiance of the Fall LitRPG series is here. Grab your copy today!</b></p> <p><b>About the Series:</b> Jump into a story that merges Apocalyptic LitRPG elements with eastern cultivation. Class systems, skill systems, endless choices for progression, it has everything fans of the genre love. Explore a vast universe full of mystery, adventure, danger and even aliens; where even a random passer-by might hold the power of a god. Follow Zac as he struggles to stake out a unique path to power as a mortal in a world full of cultivators.</p>"; 
